@app.get("/monthly_sales/{product}")
def monthly_sales(product: str) -> List[int]:
    monthly_sales = [0] * 12 
    for record in data:
        if record["software"] == product:
            month = int(record["date"].split("-")[1])  
            monthly_sales[month - 1] += record["amount"] 
    return monthly_sales

